import Styled from 'styled-components'

export default Styled.div`
    height: 100%;
    flex-direction: column;
    align-items: center;
    justify-content: space-around;
    .logo {
        display: flex;
        flex-direction: column;
        align-items: center;
        .icon {
            height: 51.2vmin;
            width: 51.2vmin;
            fill: #ccc;
        }
        h1 {
            font-family: misery;
            font-size: 15vmin;
            text-align: center;
            color: red;
            letter-spacing: 2vmin;
        }
    }
    .press-start {
        width: 100%;
        background-color: green;
        pre {
            font-family: premier;
            font-size: 3vmin;
            text-align: center;
            color: #ccc;
            animation: blink 666ms infinite;
        }
    }
`
